import React from "react";

export default function TextForm(props) {
  return (
    <div>
      <h1>{props.heading}</h1>
      <form>
        <div className="form-group">
          <label for="my-Box">Example textarea</label>
          <textarea className="form-control" id="my-Box" rows="3"></textarea>
        </div>
      </form>
    </div>
  );
}
